"use strict";const URL_GASSTAION="https://gasstation-mainnet.matic.network";export class NukoGas{option={price:0,list:null,pref:"fastest",interval:15e3,limit:3e5,labels:["fastest","faster","fast","standard","safeLow"]};async getGas(){let response=await fetch(URL_GASSTAION),json=await response.json();return this.option.list=json,this.option.list.faster=(parseInt(this.option.list.fastest)+parseInt(this.option.list.fast))/2,this.option.price=parseInt(json[this.option.pref]),this.option.price}set limit(limit){this.option.limit=limit}get list(){return this.option.list}get price(){return this.option.price}get pref(){return this.option.pref}set pref(pref){this.option.pref=pref}get interval(){return this.option.interval}get labels(){return this.option.labels}get limit(){return this.option.limit}}